import React from "react";
// 圖片引入
// 引入CSS
import "../styles/index.css"

let items = ["1", "2", "3", "4", "5", "11", "12", "13", "14", "15"];

export function Index() {
  return <>
    <div class="IllustrateGroup"
      onClick={() => {
        let IllustrateGroup = document.getElementsByClassName("IllustrateGroup")[0];
        IllustrateGroup.style.display = "none";
      }}
    >
      <h6>123</h6>
    </div>
    <div className="WellcomeMyHome">
      {items.map((item, i) => (
        <div className="HoverImg" key={i}
          onMouseMove={() => {
            let IllustrateGroup = document.getElementsByClassName("IllustrateGroup")[0];
            IllustrateGroup.style.display = "block";
            IllustrateGroup.lastElementChild.textContent = item
          }}
        >{item}</div>
      ))}
    </div>
  </>
}
